import { useState, useEffect } from "react";


import axios from "axios";

function Xml() {
    const [dataXML, setdata] = useState({});

    const getData = async () => {
        try {
            const response = await axios.get(
                "/carsData/Cars.xml",

                {
                    "Content-Type": "application/xml; charset=utf-8",
                }
            );

            setdata(response.data[0]);
        } catch (error) {
            console.log(error);
        }
    };

    useEffect(() => {
        getData();
    }, []);

    console.log(dataXML);

    return (
        <div>
            <h1>{dataXML.Id}</h1>

            <h2>{dataXML.Name}</h2>
        </div>
    );
}

export default Xml;
